def areEqual(arr1, arr2, n, m):
    if (n != m):
        return False
    # Sort both arrays 
    arr1.sort()
    arr2.sort()
    # Linearly compare elements 
    for i in range(0, n - 1):
        if (arr1[i] != arr2[i]):
            return False
    # If all elements were same.
    return True


